import "./App.css";
import NavBar from "./components/NavBar";
import Cortado from "./Cortado.png";
import GetCoffee from "./components/getCoffee";

function App() {
  return (
    <div className="App">
      <NavBar />

      <GetCoffee></GetCoffee>
      <div className="row">
        <div className="column">
          <div className="bigText">Caffeinate your day.</div>
          <div className="bigText">Sustainibly sourced. Sustainibly priced</div>

          <button className="Pretty-Button">get a free coffee</button>
        </div>
        <img src={Cortado} alt="Coffee" className="Cortado" />
      </div>

      <div className="GreyBox"></div>
    </div>
  );
}

export default App;
